import React from 'react';

function PieChart({ data, analyticsInitialized }) {
  return (
    <div className={`piechart-placeholder${analyticsInitialized ? ' analytics-initialized' : ''}`}
      style={{ border: '1px dashed #ccc', padding: 24, borderRadius: 12, background: '#f9fafb', textAlign: 'center' }}>
      <strong>Pie Chart</strong>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        {data && data.map((item, idx) => (
          <li key={idx}>{item.label}: {item.value} ({item.color})</li>
        ))}
      </ul>
    </div>
  );
}

export default PieChart;
